return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2023-07-20 09:29:55+0000','plural-forms'=>'nplurals=3; plural=(n % 10 == 1 && n % 100 != 11) ? 0 : ((n % 10 >= 2 && n % 10 <= 4 && (n % 100 < 12 || n % 100 > 14)) ? 1 : 2);','project-id-version'=>'Plugins - Google Analytics for WooCommerce - Stable (latest release)','language'=>'ru','messages'=>['5 minutes'=>'5 минут','Provides the integration between WooCommerce and Google Analytics.'=>'Обеспечивает интеграцию между WooCommerce и Google Analytics.','Set up Google Analytics'=>'Настроить Google Analytics','Enabling this option will allow incoming linker parameters from other websites.'=>'Включение этой опции позволит входящие параметры компоновщика с других веб-сайтов.','Accept Incoming Linker Parameters'=>'Прием входящих параметров линкера','Add a comma separated list of domains for automatic linking. %1$sRead more about Cross Domain Measurement%2$s'=>'Добавьте через запятую список доменов для автоматического связывания. %1$sПодробнее о кросс-доменном измерении%2$s','Cross Domain Tracking'=>'Отслеживание нескольких доменов','Log into your Google Analytics account to find your ID. e.g. <code>GT-XXXXX</code> or <code>G-XXXXX</code>'=>'Войдите в свою учётную запись Google Analytics, чтобы найти свой id. Например, <code>GT-XXXXX</code> или <code>G-XXXXX</code>.','Google Analytics Tracking ID'=>'ID отслеживания Google Analytics','Add advanced tracking for your sales funnel, coupons and more. [<a href="%s" target="_blank">Learn more</a> &gt;]'=>'Добавьте расширенные возможности отслеживания для своей воронки продаж, купонов и пр. [<a href="%s" target="_blank">Подробнее...</a> >]','Get detailed insights into your sales with Google Analytics Pro'=>'Получите подробную информацию по продажам с помощью Google Analytics Pro','Enable this to find broken or dead links. An "Event" with category "Error" and action "404 Not Found" will be created in Google Analytics for each incoming pageview to a non-existing page. By setting up a "Custom Goal" for these events within Google Analytics you can find out where broken links originated from (the referrer). %1$sRead how to set up a goal%2$s.'=>'Включите это, чтобы найти сломанные или недоступные ссылки. В Google Analytics будет создано событие с рубрикой "Ошибка" и действием "404 Страница не найдена" для каждого входящего просмотра страницы, которой не существует. Настроив "Пользовательскую цель" для этих событий в Google Analytics, вы сможете узнать, откуда происходят сломанные ссылки (реферер). %1$sПрочитайте, как настроить цель%2$s.','Track 404 (Not found) Errors'=>'Отслеживать ошибки "404 Не найдено"','Support'=>'Поддержка','Settings'=>'Настройки','Please note, for transaction tracking to work properly, you will need to use a payment gateway that redirects the customer back to a WooCommerce order received/thank you page.'=>'Обратите внимание, что для корректного отслеживания операций нужно использовать платежный шлюз, который перенаправляет клиента обратно на страницу с подтверждением заказа WooCommerce/.','Please allow Google Analytics 24 hours to start displaying results.'=>'Google Analytics начнет отображать результаты через 24 часа.','Checkout Process Initiated'=>'Запущен процесс оформления заказа','Product Detail Views'=>'Просмотры сведений о товаре','Product Clicks from Listing Pages'=>'Переходы на страницу товара со страниц каталога','Product Impressions from Listing Pages'=>'Просмотры товара на страницах каталога','Remove from Cart Events'=>'События удаления из корзины','Add to Cart Events'=>'События добавления в корзину','This requires a payment gateway that redirects to the thank you/order received page after payment. Orders paid with gateways which do not do this will not be tracked.'=>'Для этого требуется платежный шлюз, который после оплаты перенаправляет на страницу подтверждения заказа/. Заказы, оплачиваемые через другие шлюзы, не отслеживаются.','Purchase Transactions'=>'Операции покупки','Set the Google Analytics code to support Display Advertising. %1$sRead more about Display Advertising%2$s.'=>'Задать код Google Аналитики для поддержки медийной рекламы. %1$sПодробнее о медийной рекламе%2$s.','"Display Advertising" Support'=>'Поддержка медийной рекламы','Allows Google Analytics tracking code to be inserted into WooCommerce store pages.'=>'Разрешает вставлять код отслеживания Google Analytics на страницы магазина WooCommerce.','https://wordpress.org/plugins/woocommerce-google-analytics-integration/'=>'https://wordpress.org/plugins/woocommerce-google-analytics-integration/','WooCommerce'=>'WooCommerce','Google Analytics is a free service offered by Google that generates detailed statistics about the visitors to a website.'=>'Google Аналитика — это бесплатная служба Google, которая формирует подробную статистику посетителей веб-сайта.','Google Analytics'=>'Google Analytics']];